import React,{ useEffect, useState } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';

function Form() {

    const items = []

    const teamdata = async() =>{

        const dd = await axios.get('/api/team');

        for (const [index, value] of dd.data.entries()) {
            items.push(<div>{value}</div>)
            // console.log(value.name);
        }
        
    }

    useEffect(() => {
        document.title = 'from';

        teamdata();
    });

    console.log(items);

    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>from</h1>
            {items}
        </>
    )
}

export default Form
